import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.js';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'; // Импортируем нужные компоненты
import Login from './Login'; // Импортируем компонент Login

function Header() {
  return (
    <header className="d-flex flex-wrap justify-content-center py-3 mb-4 border-bottom">
      <a href="/" className="d-flex align-items-center mb-3 mb-md-0 me-md-auto text-dark text-decoration-none">
        <span className="fs-4">
          <img src={images.logo} width="300px" height="40px" />
        </span>
      </a>
      <ul className="nav nav-pills">
        <a className="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Казань</a>
        <li
        className="nav-item"
        >
        <Link
        to="/Login" // Изменяем на Link
        className="nav-link"
        >
        <img src={images.icon} width="30px" height="25px" /></Link></li>
      </ul>
    </header>
  );
}



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

reportWebVitals();
